import React from 'react';

function MinimalistTemplate({ user }) {
  return (
    <div style={{ 
      maxWidth: '800px', 
      margin: '0 auto', 
      padding: '60px 20px',
      fontFamily: '"Courier New", monospace',
      color: '#333'
    }}>
      {/* Header */}
      <header style={{ marginBottom: '60px' }}>
        <h1 style={{ 
          fontSize: '48px', 
          fontWeight: 'normal',
          marginBottom: '10px',
          letterSpacing: '-1px'
        }}>
          {user.profile?.name || user.username}
        </h1>
        <p style={{ 
          fontSize: '18px', 
          color: '#666',
          marginBottom: '20px',
          fontStyle: 'italic'
        }}>
          {user.profile?.bio || 'Developer'}
        </p>
        
        {/* Social Links */}
        <div style={{ display: 'flex', gap: '20px' }}>
          {user.profile?.socials?.github && (
            <a href={user.profile.socials.github} target="_blank" rel="noopener noreferrer"
               style={{ color: '#333', textDecoration: 'underline' }}>
              github
            </a>
          )}
          {user.profile?.socials?.linkedin && (
            <a href={user.profile.socials.linkedin} target="_blank" rel="noopener noreferrer"
               style={{ color: '#333', textDecoration: 'underline' }}>
              linkedin
            </a>
          )}
          {user.profile?.socials?.twitter && (
            <a href={user.profile.socials.twitter} target="_blank" rel="noopener noreferrer"
               style={{ color: '#333', textDecoration: 'underline' }}>
              twitter
            </a>
          )}
        </div>
      </header>

      {/* Projects */}
      {user.projects && user.projects.length > 0 && (
        <section style={{ marginBottom: '60px' }}>
          <h2 style={{ 
            fontSize: '24px', 
            marginBottom: '30px',
            fontWeight: 'normal',
            borderBottom: '1px solid #333',
            paddingBottom: '10px'
          }}>
            projects
          </h2>
          {user.projects.map((project, index) => (
            <div key={index} style={{ marginBottom: '40px' }}>
              <h3 style={{ fontSize: '20px', marginBottom: '10px' }}>
                {project.title}
              </h3>
              <p style={{ color: '#666', marginBottom: '10px', lineHeight: '1.6' }}>
                {project.description}
              </p>
              {project.techStack && (
                <p style={{ fontSize: '14px', color: '#999', marginBottom: '10px' }}>
                  [{project.techStack.join(', ')}]
                </p>
              )}
              <div style={{ display: 'flex', gap: '15px' }}>
                {project.repoLink && (
                  <a href={project.repoLink} target="_blank" rel="noopener noreferrer"
                     style={{ color: '#333', textDecoration: 'underline' }}>
                    code
                  </a>
                )}
                {project.liveLink && (
                  <a href={project.liveLink} target="_blank" rel="noopener noreferrer"
                     style={{ color: '#333', textDecoration: 'underline' }}>
                    demo
                  </a>
                )}
              </div>
            </div>
          ))}
        </section>
      )}

      {/* Skills */}
      {user.skills && (
        <section>
          <h2 style={{ 
            fontSize: '24px', 
            marginBottom: '30px',
            fontWeight: 'normal',
            borderBottom: '1px solid #333',
            paddingBottom: '10px'
          }}>
            skills
          </h2>
          <div style={{ display: 'grid', gridTemplateColumns: 'repeat(2, 1fr)', gap: '20px' }}>
            {user.skills.frontend && user.skills.frontend.length > 0 && (
              <div>
                <h3 style={{ fontSize: '16px', marginBottom: '10px' }}>frontend</h3>
                <p style={{ color: '#666' }}>{user.skills.frontend.join(', ')}</p>
              </div>
            )}
            {user.skills.backend && user.skills.backend.length > 0 && (
              <div>
                <h3 style={{ fontSize: '16px', marginBottom: '10px' }}>backend</h3>
                <p style={{ color: '#666' }}>{user.skills.backend.join(', ')}</p>
              </div>
            )}
            {user.skills.devops && user.skills.devops.length > 0 && (
              <div>
                <h3 style={{ fontSize: '16px', marginBottom: '10px' }}>devops</h3>
                <p style={{ color: '#666' }}>{user.skills.devops.join(', ')}</p>
              </div>
            )}
            {user.skills.tools && user.skills.tools.length > 0 && (
              <div>
                <h3 style={{ fontSize: '16px', marginBottom: '10px' }}>tools</h3>
                <p style={{ color: '#666' }}>{user.skills.tools.join(', ')}</p>
              </div>
            )}
          </div>
        </section>
      )}
    </div>
  );
}

export default MinimalistTemplate;
